import React from 'react';
import {Navigate,Outlet} from 'react-router-dom';
  const PublicRoutes = () =>  {
    let navigate = useNavigate();
    const token = localStorage.getItem('token');
	return (
            token ? <Navigate to='/login' /> : <Outlet />
	);
  }
export default PublicRoutes;
